import React, {useState,useEffect} from 'react';
import {Col, Row, Form, Switch, Button, Descriptions,} from 'antd';
import { Statistic } from 'antd';
import { Typography } from 'antd';
import { AudioOutlined } from '@ant-design/icons';
import { List, Input, Space } from 'antd';
import axios from "axios";
import Card from "antd/es/card/Card";

const { Search } = Input;


const Home = () => {
    const [balance,setBalance]=useState(0);
    const [querySym,setQuerySym]=useState('-');
    const [queryPrice,setQueryPrice]=useState('-');

    useEffect(()=>{
        let url = 'http://localhost:8080/balance/query';
        axios.get(url)
            .then(function (response) {
                let data=response.data.data;
                if(data !== "-1"){
                    console.log(data);
                    setBalance(data);

                }else{
                    console.log("fuck");
                }
            })
            .catch(function (error) {
                console.log(error);
            });
    },[])
    const onSearch = (value) => {
        console.log(value);
        let url = 'http://localhost:8080/stock/queryprice/' + value;
        axios.get(url)
            .then(function (response) {
                let data=response.data.data;
                if(data !== "-1"){
                    console.log(data);
                    setQuerySym(value);
                    setQueryPrice(data);
                }else{
                    console.log("unknown error");
                }
            })
            .catch(function (error) {
                console.log(error);
            });
    };

    const onDeposit = (value) => {
        console.log(value);
        let bodyFormData = new FormData();
        bodyFormData.append('cash',value);
        let url = 'http://localhost:8080/balance/deposit';
        axios.post(url,bodyFormData)
            .then(function (response) {
                console.log(response.data.data);
                setBalance(response.data.data);
            })
            .catch(function (error) {
                console.log(error);
            });
    };

    const onWithdraw = (value) => {
        console.log(value);
        let bodyFormData = new FormData();
        bodyFormData.append('cash',value);
        let url = 'http://localhost:8080/balance/withdraw';
        axios.post(url, bodyFormData)
            .then(function (response) {
                console.log(response.data.data);
                setBalance(response.data.data);
            })
            .catch(function (error) {
                console.log(error);
            });
    };



    return (
        <div>
            <div>
                <h1>STOCK MANAGEMENT</h1>
            </div>
            <div>
                <Row>
                    <Col span={8}></Col>
                    <Col span={8}>
                        <Statistic title="Account Balance (AUD)" value={balance} precision={2} />
                    </Col>
                    <Col span={8}></Col>
                </Row>

            </div>

            <div>
                <Row>
                    <Col span = {8}></Col>
                    <Col span = {4}>
                        <Space>
                            <Search
                                placeholder="amounts of cash"
                                enterButton="Deposit"
                                size="large"
                                onSearch={onDeposit}
                                // onChange={}
                            />
                        </Space>
                    </Col>

                    <Col span ={4}>
                        <Space>
                            <Search
                                placeholder="amounts of cash"
                                enterButton="Withdraw"
                                size="large"
                                onSearch={onWithdraw}
                            />
                        </Space>
                    </Col>
                    <Col span = {8}></Col>
                </Row>
            </div>
            <div className="site-card-wrapper">
                <Row gutter={16}>
                    <Col span={8}></Col>
                    <Col span={8}>
                        <Statistic title={`Current Price (${querySym})`} value={queryPrice} precision={2} />
                    </Col>
                    <Col span={8}></Col>
                </Row>
            </div>
            <div>
                <Row>
                    <Col span ={8}></Col>
                    <Col span ={8}>
                        <Space>
                            <Search
                                placeholder="Input stock sym"
                                enterButton="Query"
                                size="large"
                                onSearch={onSearch}
                            />
                        </Space>
                    </Col>
                    <Col span ={8}></Col>
                </Row>
            </div>

        </div>
    );
};

export default Home;
